var baconMouseOver = function() {

	var ogg_prefix = "data:audio/ogg;base64,";
	var oggs = [
		""
	];
	var mp3_prefix = "data:audio/mp3;base64,";
	var mp3s = [
	    ""
	];

    var player_container = document.getElementById('baconMouseOver');
    if (player_container === null) {
	    player_container = document.createElement('div');
	    player_container.id = 'baconMouseOver';
	    document.getElementsByTagName('body')[0].appendChild(player_container);
    }
    
    function getPlayer() {
    	var players = player_container.getElementsByTagName('audio');
    	for (var i = 0; i < players.length; i++) {
    		if (players[i].currentTime === 0 || players[i].ended) {
    			return players[i];
    		} 
    	}

    	// All the current players are busy, let's make a new one!
    	var newPlayer = document.createElement('audio');
    	newPlayer.setAttribute('loop', '');
    	player_container.appendChild(newPlayer);
    	return newPlayer;
    }

    var audio;
    var prefix;
    var player = getPlayer();
    if(player.canPlayType('audio/mp3')) { // all normal browsers.
        audio = mp3s;
        prefix = mp3_prefix;
    } else if(player.canPlayType("audio/ogg")) { // firefox i hate you.
        audio = oggs;
        prefix = ogg_prefix;
    }

    var baconate = function () {
        var rand = Math.floor(Math.random() * audio.length);
        var player = getPlayer();
        player.src = prefix + audio[0];
        player.play();
    }
    var debaconate = function () {
    	var node = document.getElementById('baconMouseOver');
		while (node.hasChildNodes()) {
		    node.removeChild(node.firstChild);
		}
    }

    // bind mouseover and mouseout events to .bacon
    var baconz = document.getElementsByClassName('bacon');
    for (var i = 0; i < baconz.length; i++) {
    	baconz[i].addEventListener('mouseover', baconate, false);
		baconz[i].addEventListener('mouseout', debaconate, false);
    }
};

baconMouseOver();